import logo from './logo.svg';
import profileImage from './src/img/dp.JPG'
import './App.css';

function App() {
  return (
    <div className="App">
	<h1>Tarang Patel </h1>
	<h1> Embedded Software Engineer </h1>
        <img src={profileImage} className="App-logo" alt="logo" />

    </div>
  );
}

export default App;
